INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('SEIS', 'STOCK', 'SEI Select Small Cap ETF', 'NGM', NULL, NULL, 'Under normal circumstances, the fund will invest at least 80% of its net assets (plus the amount of any borrowings for investment purposes) in equity securities of small companies. For purposes of this fund, a small company is a company with a market capitalization in the range of companies in the Russell 2000 Index.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ECOR', 'STOCK', 'electroCore, Inc.', 'NCM', 'Healthcare', 'Medical Devices', 'electroCore, Inc. is a commercial stage bioelectronic medicine and wellness company focused on improving health through its non-invasive vagus nerve stimulation (nVNS) technology platform and related product offerings. The Companys portfolio also includes Quell, a wearable, app and cloud-enabled neuromodulation platform that is indicated for the treatment of fibromyalgia symptoms and lower-extremity chronic pain. Its product categories include handheld, personal use medical devices for the management and treatment of certain medical conditions such as primary headaches, and handheld, personal use consumer products. Its products include gammaCore, Quell Fibromyalgia, Truvaga and TAC-STIM. Its gammaCore Sapphire is a prescription medical device that is used for a variety of primary headache conditions. Truvaga is a personal-use consumer electronics general wellness product that does not require a prescription and is available direct-to-consumer from electroCore at www.truvaga.com.', 'Rockaway, NJ, United States', 73);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DERM', 'STOCK', 'Journey Medical Corporation', 'NCM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Journey Medical Corporation is a commercial-stage pharmaceutical company. The Company is focused on selling and marketing of the United States Food and Drug Administration (FDA) approved prescription pharmaceutical products for the treatment of dermatological conditions. Its portfolio includes eight FDA-approved prescription drugs for dermatological conditions that are marketed in the United States. Its marketed products, which have been approved FDA for sale in the United States, include Qbrexza, Accutane, Amzeeq, Zilxi, Exelderm Cream and Solution, Targadox, and Luxamend. Qbrexza is a medicated cloth towelette for the treatment of primary axillary hyperhidrosis. Accutane is an oral isotretinoin drug for the treatment of severe recalcitrant nodular acne. Targadox is an oral doxycycline drug for adjunctive therapy for severe acne. Luxamend is a water-based emulsion formulated to provide moist healing environment.', 'Scottsdale, AZ, United States', 41);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRT', 'STOCK', 'Cross Timbers Royalty Trust', 'NYQ', 'Energy', 'Oil & Gas E&P', 'Cross Timbers Royalty Trust operates as an express trust in the United States. It holds 90% net profits interests in certain producing and nonproducing royalty and overriding royalty interest properties in Texas, Oklahoma, and New Mexico; and 75% net profits working interest in four properties in Texas and three properties in Oklahoma. The company was founded in 1991 and is headquartered in Dallas, Texas.', 'Dallas, TX, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALRS', 'STOCK', 'Alerus Financial Corporation', 'NCM', 'Financial Services', 'Banks - Regional', 'Alerus Financial Corporation is a diversified financial services company. Through the Companys subsidiary, Alerus Financial, National Association (the Bank), the Company provides financial solutions to businesses and consumers through three distinct business segments: banking, retirement and benefit services, and wealth. Its commercial lending products include commercial loans, business term loans and lines of credit for small and midsize businesses. Its consumer lending products include residential first mortgage loans. It offers deposit products and services, including demand deposits, interest-bearing transaction accounts, money market accounts, time and savings deposits, and certificates of deposit. It also offers a range of treasury management products, including electronic receivables management, remote deposit capture, cash vault services, merchant services, and other cash management services. Its wealth division provides fiduciary services to consumer and commercial clients.', 'Grand Forks, ND, United States', 846);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DSY', 'STOCK', 'Big Tree Cloud Holdings Limited', 'NGM', 'Consumer Defensive', 'Household & Personal Products', 'Big Tree Cloud Holdings Ltd is a China-based company principally engaged in the development, production and sales of personal care products and other consumer goods. The Company delivers products that cater to the needs of modern, health-conscious, and independent consumers. It focuses on the development and production of feminine hygiene products, including sterilized feminine pads, menstrual pants, and other feminine hygiene products. Its body and oral care products include shampoo and conditioner, body wash, facial mask and cream, and others. Its accessories include earrings, bracelets, pendants and other jewelry accessories. It distributes its products through its flagship stores on e-commerce platforms. The Company also engages in licensing business by authorizing its customers and third-party commercial stores to use its logo, trademark and brand name.', 'Shenzhen, , China', 50);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DFP', 'STOCK', 'Flaherty & Crumrine Dynamic Preferred and Income Fund Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Flaherty & Crumrine Dynamic Preferred and Income Fund Inc. is a closed ended balanced mutual fund launched and managed by Flaherty & Crumrine Incorporated. The fund invests in the public equity and fixed income markets across the globe. It seeks to invest in stocks of companies operating across diversified sectors. The fund primarily invests in investment grade securities consisting of preferred securities and other income-producing securities issued by companies which include traditional preferred stock, trust preferred securities, hybrid securities that have characteristics of equity and debt securities, convertible securities, subordinated debt, and senior debt. Flaherty & Crumrine Dynamic Preferred and Income Fund Inc. was formed on May 23, 2013 and is domiciled in the United States.', 'Pasadena, CA, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVNW', 'STOCK', 'Aviat Networks, Inc.', 'NMS', 'Technology', 'Communication Equipment', 'Aviat Networks, Inc. specializes in wireless transport and access solutions and works to provide products, services and support to its customers. The Company''s products utilize microwave and millimeter wave technologies to create point to point and point to multi-point wireless links for short, medium and long-distance interconnections. In addition to its wireless products, it also provides routers and a range of premise and hosted private cloud-based software tools and applications to enable deployment, monitoring, network management, and optimization and operational assurance of its systems as well as to automate network design and procurement. It also sources, qualifies, supplies, integrates, tests and supports third party equipment such as antennas, optical transmission equipment and other equipment necessary to build and deploy a complete telecommunications transmission network. Its two principal customer types are communications service providers and private network operators.', 'Austin, TX, United States', 909);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FGSN', 'STOCK', 'F&G Annuities & Life, Inc. 7.30', 'NYQ', NULL, NULL, 'F&G Annuities & Life, Inc. is a provider of insurance solutions serving retail annuity and life customers, as well as institutional clients. Through its subsidiaries, it markets a portfolio of annuities, including fixed indexed annuities (FIAs), registered index-linked annuities (RILAs), (referred to as indexed annuities), multi-year guarantee annuities (MYGAs) as well as pension risk transfer (PRT) solutions, indexed universal life (IUL) insurance and institutional funding agreements. Its retail annuities serve as a retirement and savings tool on which its customers rely for principal protection and predictable income streams. In addition, its life insurance products provide its customers with a complementary product that allows them to build on their savings and provide a payment to their designated beneficiaries upon the policyholder''s death. Its customers value its FIAs, which provide a portion of the gains of an underlying market index, while also providing principal protection.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DRLL', 'STOCK', 'Strive U.S. Energy ETF', 'NYQ', NULL, NULL, 'The fund seeks to track the investment results of the Bloomberg US Energy Select Index, which measures the performance of U.S. oil and gas producers. The index is designed by Bloomberg Index Services Limited and consists of U.S. equity securities. It is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BMN', 'STOCK', 'Blackrock 2037 Municipal Target Term Trust', 'NYQ', 'Financial Services', 'Asset Management', 'Blackrock 2037 Municipal Target Term Trust is an close-ended fixed income mutual fund launched by Blackrock, Inc. The fund is managed by BlackRock Advisors, LLC. It invests in fixed income markets. The fund primarily invests in n investment grade municipal securities that are rated BBB- or above by S&P and Fitch or Baa3 or above by Moody''s. Blackrock 2037 Municipal Target Term Trust is domiciled in the United States.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CJMB', 'STOCK', 'Callan JMB Inc.', 'NCM', 'Industrials', 'Integrated Freight & Logistics', 'Callan JMB Inc. is a vertically integrated logistics and fulfillment company, which provides thermal management logistics solutions to the life sciences industry through a combination of proprietary packaging, information technology and specialized cold chain logistics knowhow. The Company provides comprehensive alternatives to all logistics solutions and services utilized for frozen shipping in the life sciences industry (personalized medicine, cell therapies, stem cells, cell lines, vaccines, diagnostic materials, semen, eggs, embryos, cord blood, organs, biopharmaceuticals, infectious substances, and other commodities that require continuous exposure to cryogenic or frozen temperatures). Its Ship2Q ultraviolet disinfection process (Safe Hygienic Irradiation Performance Process & Qualification) ensures fitness, thermal reliability, and cleanliness of the system components within the manufacturers specifications equal to new off-the-shelf shipper systems.', 'Spring Branch, TX, United States', 26);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('MBUU', 'STOCK', 'Malibu Boats, Inc.', 'NGM', 'Consumer Cyclical', 'Recreational Vehicles', 'Malibu Boats, Inc. is a designer, manufacturer and marketer of a diverse range of recreational powerboats, including performance sport, sterndrive and outboard boats. The Company''s brands include Malibu, Axis, Pursuit, Maverick, Cobia, Pathfinder, Hewes and Cobalt. Its segments include Malibu, Saltwater Fishing and Cobalt. Its Malibu segment participates in the manufacturing, distribution, marketing and sale of Malibu and Axis performance sports boats. Its product portfolio of premium brands is used for a range of recreational boating activities including, among others, water sports, general recreational boating and fishing. Its Saltwater Fishing segment participates in the manufacturing, distribution, marketing and sale throughout the world of Pursuit boats and the Maverick Boat Group family of boats (Maverick, Cobia, Pathfinder and Hewes). The Companys Cobalt segment is engaged in manufacturing, distribution, marketing and sale of Cobalt boats throughout the world.', 'Loudon, TN, United States', 2250);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ESQ', 'STOCK', 'Esquire Financial Holdings, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'Esquire Financial Holdings, Inc. is a financial holding company, which operates through its subsidiary, Esquire Bank, National Association (the Bank). The Bank is a full-service commercial bank dedicated to serving the financial needs of the legal and small business communities on a national basis, as well as commercial and retail customers in the New York metropolitan market. It offers tailored products and solutions to the legal community and their clients as well as dynamic and flexible payment processing solutions to small business owners, both on a national basis. The Bank also offers traditional banking products for businesses and consumers in its local market area. Its products offered to businesses and consumers include checking, savings, money market, and time deposits, a wide range of commercial and consumer loans, as well as customary banking services. The Bank operates a payment processing platform through third-party Independent Sales Organizations (ISOs).', 'Jericho, NY, United States', 138);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AOUT', 'STOCK', 'American Outdoor Brands, Inc.', 'NMS', 'Consumer Cyclical', 'Leisure', 'American Outdoor Brands, Inc. is a provider of outdoor lifestyle products and shooting sports accessories. The Company''s outdoor lifestyle products and shooting sports accessories include hunting, fishing, outdoor cooking, camping, shooting, and personal security and defense products, for rugged outdoor enthusiasts. It designs, conceives, sources and sells its outdoor lifestyle products, including premium sportsman knives and tools for fishing and hunting; land management tools for hunting preparedness; harvesting products for post-hunt or post-fishing activities; outdoor cooking products; and camping, survival, and emergency preparedness products. The Company distributes its products through e-commerce and traditional distribution channels. The Company offers its products under various brands, such as BOG, BUBBA, Caldwell, Crimson Trace, Frankford Arsenal, Grilla Grills, Hooyman, Imperial, LaserLyte, Lockdown, MEAT! Your Maker, Old Timer, Schrade, Tipton, Uncle Henry, ust and Wheeler', 'Columbia, MO, United States', 299);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVTX', 'STOCK', 'Avalo Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Avalo Therapeutics, Inc. is a clinical-stage biotechnology company focused on the treatment of immune dysregulation. The Company''s lead asset is AVTX-009, an anti-IL-1? mAb, targeting inflammatory diseases. Its pipeline also includes quisovalimab (anti-LIGHT mAb) and AVTX-008 (BTLA agonist fusion protein). AVTX-009 is a humanized monoclonal antibody (IgG4) that binds to interleukin-1? (IL-1?) with high affinity and neutralizes its activity. IL- 1? is a central driver in the inflammatory process. Quisovalimab is a fully human monoclonal antibody (mAb), directed against human LIGHT (Lymphotoxin-like, exhibits Inducible expression, and competes with Herpes Virus Glycoprotein D for Herpesvirus Entry Mediator (HVEM), a receptor expressed by T lymphocytes). AVTX-008 is a fully human B and T Lymphocyte Attenuator (BTLA) agonist fusion protein. AVTX-008 is differentiated by having specific binding to BTLA, with no binding to LIGHT or CD160.', 'Rockville, MD, United States', 23);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVAL', 'STOCK', 'Grupo Aval Acciones y Valores S.A.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Grupo Aval Acciones y Valores SA is a Colombia-based holding company primarily engaged, through its subsidiaries, in the acquisition, purchase and sale of stocks, bonds and other securities of companies active in the financial sector. The Company provides a variety of financial services and products across the Colombian market, ranging from traditional banking services, such as loans and deposits to pension and severance fund management, as well as the provision of legal representation services. The Company owns such subsidiaries as Banco de Bogota SA, Banco Popular SA, among others. Additionally, through its indirect and direct investments in other companies, the Company is present in the activities of investment baking and investments in the real sector, as well as the administrator of pension and severance funds in Colombia.', 'Bogotá, , Colombia', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BEPJ', 'STOCK', 'Brookfield BRP Holdings (Canada', 'NYQ', NULL, NULL, NULL, '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHSCM', 'STOCK', 'CHS Inc.', 'NMS', 'Consumer Defensive', 'Farm Products', 'CHS Inc. is an integrated agricultural company, which provides grain, food, agronomy and energy resources to businesses and consumers on a global basis. It provides a variety of products and services, ranging from initial agricultural inputs such as fuels, farm supplies, crop nutrients and crop protection products to agricultural outputs that include grain and oilseed, processed grain and oilseed, renewable fuels and food products. It operates through three segments: Energy, Ag and Nitrogen Production. Its Energy segment produces and sells (primarily wholesale) gasoline, diesel fuel, propane, asphalt, lubricants and other related products, and also provides transportation services. Its Ag segment includes global grain and processing, ag retail and wholesale agronomy businesses. Its Nitrogen Production segment consists of its equity method investment in CF Industries Nitrogen, LLC (CF Nitrogen), which produces nitrogen-based products, including methanol, UAN, urea and related products.', 'Inver Grove Heights, MN, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DMYY', 'STOCK', 'dMY Squared Technology Group, Inc.', 'ASE', 'Financial Services', 'Shell Companies', 'dMY Squared Technology Group, Inc. is a blank check company. The Company is formed for the purpose of effecting a merger, capital stock exchange, asset acquisition, stock purchase, reorganization or similar business combination with one or more businesses. It intends to focus its search for an initial business combination on companies within the professional service industry that provide accounting, legal, financial, advisory or other services to public companies or private companies that are in the process of becoming public companies. The Company has no operations and has generated no revenues.', 'Las Vegas, NV, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COOT', 'STOCK', 'Australian Oilseeds Holdings Limited', 'NGM', 'Consumer Defensive', 'Packaged Foods', 'Australian Oilseeds Holdings Limited, through its subsidiaries, including Australian Oilseeds Investments Pty Ltd., is focused on the manufacture and sale of sustainable oilseeds. The Company is working with all suppliers in the food supply chain to eliminate chemicals from the production and manufacturing systems to supply quality products to customers globally. The Company is engaged in the business of processing, manufacturing and sale of non-GMO (non-genetically modified organisms) oilseeds and organic and non-organic food-grade oils, for the rapidly growing oilseeds market, through sourcing materials from suppliers focused on reducing the use of chemicals in consumables in order to supply healthier food ingredients, vegetable oils, proteins and other products to customers globally. It operates cold pressing oil plants in Australia. Its subsidiaries include EDOC Acquisition Limited, Good Earth Oils Pty Ltd., Australian Oilseeds Pty Ltd., among others.', 'Cootamundra, NSW, Australia', 14);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ESLT', 'STOCK', 'Elbit Systems Ltd.', 'NMS', 'Industrials', 'Aerospace & Defense', 'Elbit Systems Ltd. is an international technology company engaged in a range of programs across the world. The Company develops and supplies a portfolio of airborne, land and naval systems and products for defense, homeland security and commercial aviation applications. Its systems and products are installed on new platforms, and it also performs platform modernization programs. In addition, it provides a range of support services. The Company''s activities include military aircraft and helicopter systems; helmet mounted systems; commercial aviation systems and aerostructures; unmanned aircraft and unmanned surface vessels; land vehicle systems; command, control, communications, computer and intelligence (C4I) systems; intelligence and cyber systems; electro-optic and countermeasures systems; electronic warfare and signal intelligence systems, and various commercial activities. It operates primarily in the defense and homeland security arenas.', 'Haifa, , Israel', 20000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLAR', 'STOCK', 'Clarus Corporation', 'NMS', 'Consumer Cyclical', 'Leisure', 'Clarus Corporation is a designer, developer, manufacturer and distributor of outdoor equipment and lifestyle products focused on the outdoor markets. Its products are sold globally under the Black Diamond, Rhino-Rack, MAXTRAX, and TRED Outdoors brand names through outdoor specialty and online retailers, its own websites, distributors, and original equipment manufacturers. Its segments include Outdoor and Adventure. The Outdoor segment offers a range of products including activity-based apparel, such as shells, insulation, midlayers, pants and logowear; rock-climbing footwear and equipment, such as carabiners, protection devices, harnesses, belay devices, helmets, and ice-climbing gear; technical backpacks and day packs; trekking poles; headlamps and lanterns, and gloves and mittens. The Adventure segment, which includes Rhino-Rack, MAXTRAX, and TRED, is a manufacturer of engineered automotive roof racks, trays, mounting systems, luggage boxes, and carriers.', 'Salt Lake City, UT, United States', 470);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COPP', 'STOCK', 'Sprott Copper Miners ETF', 'NGM', NULL, NULL, 'The fund will, under normal circumstances, invest at least 80% of its total assets in securities of the index. The index is designed to track the performance of companies that derive at least 50% of their revenue and/or assets from mining, exploration, development, and production of copper. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CASS', 'STOCK', 'Cass Information Systems, Inc.', 'NMS', 'Industrials', 'Specialty Business Services', 'Cass Information Systems, Inc. is a provider of integrated information and payment management solutions. The Company enables enterprises to control their supply chains, communications networks, facilities and other operations. Its segments include Information Services and Banking Services. The Information Services segment provides transportation, energy, telecommunication, and environmental invoice processing and payment services to large corporations. In addition, this segment provides church management software and on-line generosity services primarily for faith-based ministries. The Company''s AcuAudit is a premier freight audit platform for ocean and international air freight. The Banking Services segment provides banking services primarily to privately held businesses, franchise restaurants and faith-based ministries, as well as supporting the banking needs of the Information Services segment. The Company''s bank subsidiary, Cass Commercial Bank, supports its payment operations.', 'St. Louis, MO, United States', 999);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DGLY', 'STOCK', 'Digital Ally, Inc.', 'NCM', 'Communication Services', 'Internet Content & Information', 'Digital Ally, Inc., through its subsidiaries, is engaged in video solution technology, human and animal health protection products, healthcare revenue cycle management, ticket brokering and marketing, event production and jet chartering. The Video Solutions Segment produces digital video imaging, storage products, disinfectants and related safety products for use in law enforcement, security and commercial applications. This segment includes both service and product revenues through its subscription models offering cloud and warranty solutions, and hardware sales for video and health and safety solutions. The Revenue Cycle Management Segment provides working capital and back-office services to a variety of healthcare organizations throughout the country. The Entertainment Segment acts as an intermediary between ticket buyers and sellers within its secondary ticketing platform, ticketsmarter.com, and acquires tickets from primary sellers to then sell through various platforms.', 'Overland Park, KS, United States', 31);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BGR', 'STOCK', 'BlackRock Energy and Resources Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Energy and Resources Trust is a closed-ended equity mutual fund launched by BlackRock, Inc. The fund is co-managed by BlackRock Advisors, LLC and BlackRock International Limited. It invests in public equity markets across the globe, with an emphasis on the United States. The fund seeks to invest in stocks of companies operating in the energy and natural resources sectors. It invests in stocks of companies across all market capitalizations. The fund also invests through equity derivatives, with an emphasis on option writing. It was formerly known as BlackRock Global Energy and Resources Trust. BlackRock Energy and Resources Trust was formed on December 23, 2004 and is domiciled in the United States.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CODA', 'STOCK', 'Coda Octopus Group, Inc.', 'NCM', 'Industrials', 'Aerospace & Defense', 'Coda Octopus Group, Inc. is a supplier to the underwater/subsea market. It operates through two businesses: Marine technology business and Marine engineering business. Its marine technology business provides technology solutions for the subsea and underwater market. Its marine engineering business supplies embedded solutions and sub-assemblies which it designs and manufactures and sells as an integrated defense system. It supplies a range of hardware and software solutions to this market which includes key proprietary real time 4D/5D/6D imaging sonars, marketed under the name Echoscope and Echoscope PIPE, addressing the underwater imaging sensor market, along with Diver Augmented Vision Display (DAVD) system technology. The Companys Echoscope PIPE sonar generates real-time 3D/4D/5D images of moving objects underwater including in zero visibility water conditions. Its Echoscope technology is used in both the commercial offshore market and the defense underwater market applications.', 'Orlando, FL, United States', 103);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EVM', 'STOCK', 'Eaton Vance California Municipal Bond Fund', 'ASE', 'Financial Services', 'Asset Management', 'Eaton Vance California Municipal Bond Fund is a close-ended fixed income mutual fund launched and managed by Eaton Vance Management. The fund invests in the fixed income market of United States. It invests primarily in high grade municipal obligations comprising of various industries, such as general obligations, hospital, electric utilities, transportation, water and sewer, public education, and private education. The fund was formerly known as Eaton Vance Insured California Municipal Bond Fund. Eaton Vance California Municipal Bond Fund was formed in 2002 and is domiciled in United States.', 'Boston, MA, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EOT', 'STOCK', 'Eaton Vance National Municipal Opportunities Trust', 'NYQ', 'Financial Services', 'Asset Management', 'Eaton Vance National Municipal Opportunities Trust is a close-ended fixed income mutual fund launched and managed by Eaton Vance Management. The fund invests in fixed income markets of the United States. It primarily invests its assets in municipal obligations. The fund conducts in-house research to make its investments. Eaton Vance National Municipal Opportunities Trust was formed on May 29, 2009 and is domiciled in the United States.', 'Boston, MA, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BOSC', 'STOCK', 'B.O.S. Better Online Solutions Ltd.', 'NCM', 'Technology', 'Communication Equipment', 'B.O.S. Better Online Solutions Ltd. (BOS) is a provider of automatic identification and data capture (AIDC) mobility solutions. The Company distributes electronic components for the civil aircraft industry, defense industry and high technology equipment manufacturers. The Company operates through two segments: the RFID and Mobile Solutions and the Supply Chain Solutions. The Company''s RFID and Mobile Solutions division offers integration of solutions, as well as stand-alone products, including radio frequency identification (RFID) and AIDC hardware and communications equipment, and industry-specific software applications. The Company''s Supply Chain Solutions division provides electronic components, telecommunications equipment and components consolidation services to the aerospace, defense, medical and telecommunications industries, and enterprise customers around the world. The Company serves the avionics, defense, retail, manufacturers, government and livestock markets.', 'Rishon LeZion, , Israel', 80);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPK', 'STOCK', 'Chesapeake Utilities Corporation', 'NYQ', 'Utilities', 'Utilities - Regulated Gas', 'Chesapeake Utilities Corporation is a diversified energy delivery company. The Company offers sustainable energy solutions through its natural gas transmission and distribution, electricity generation and distribution, propane gas distribution, mobile compressed natural gas utility services and solutions, and other businesses. Its Regulated Energy segment includes energy distribution and transmission services (natural gas distribution, natural gas transmission and electric distribution operations). Its Unregulated Energy segment includes energy transmission, energy generation (the operations of its Eight Flags'' CHP plant), propane distribution operations, mobile compressed natural gas distribution and pipeline solutions operations, and sustainable energy investments, including renewable natural gas related investments. It also includes other unregulated energy services, such as energy-related merchandise sales and heating, ventilation and air conditioning, plumbing, and others.', 'Dover, DE, United States', 1200);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CBL', 'STOCK', 'CBL & Associates Properties, Inc.', 'NYQ', 'Real Estate', 'REIT - Retail', 'CBL & Associates Properties, Inc. is a self-managed, self-administered, fully integrated real estate investment trust (REIT). The Company is engaged in the ownership, development, acquisition, leasing, management and operation of regional shopping malls, outlet centers, lifestyle centers, open-air centers and other properties. The Companys segments include Malls, Lifestyle centers, Outlet centers, and Open-air centers. The Company owns and manages a portfolio of approximately 87 properties totaling 53.9 million square feet across 21 states, including 52 high-quality enclosed malls, outlet centers and lifestyle retail centers as well as more than 30 open-air centers and other assets. The Companys portfolio includes The Courtyard at Hickory Hollow, Parkdale Mall, Parkdale Crossing, Harford Mall Annex, Kirkwood Mall, Eastland Mall, Brookfield Square, Sunrise Mall, Sunrise Commons, Alamance Crossing West, Post Oak Mall, Southpark Mall, Hanes Mall, and York Galleria.', 'Chattanooga, TN, United States', 390);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BGM', 'STOCK', 'BGM Group Ltd.', 'NCM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'BGM Group Ltd, formerly Qilian International Holding Group Ltd, is a company mainly engaged in the development, manufacture, marketing and sale of licorice products, oxytetracycline products, traditional Chinese medicine derivatives (TCMD) product, heparin product, sausage casings and fertilizers. The Company operates through three segments: Oxytetracycline & Licorice Products and TCMD segment, Fertilizer segment and Heparin Products and Sausage Casing segment. The Company''s main brand is Qilian Shan. The Company principally operates its businesses within the domestic market.', 'Chengdu, , China', 298);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDLR', 'STOCK', 'Cadeler A/S', 'NYQ', 'Industrials', 'Engineering & Construction', 'Cadeler A/S is a Denmark-based supplier within the offshore wind industry for installation services and marine and engineering operations with a focus on safety and the environment. Cadelers experience as provider of offshore wind support services, combined with cutting-edge vessel design, positions the Company to deliver services to the industry. It also delivers high-end offshore wind turbine installation vessels. The Company owns and operates two offshore jack-up windfarm installation vessels, Wind Orca and Wind Osprey. In addition to wind farm installation, these vessels can perform maintenance, construction, decommissioning, and other tasks within the offshore industry. Cadeler A/S has two subsidiaries: Wind Orca Ltd as well as Wind Osprey Ltd.', 'Copenhagen, , Denmark', 752);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLSM', 'STOCK', 'ETC Cabana Target Leading Sector Moderate ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange-traded fund (“ETF”) that seeks to achieve its investment objective primarily by allocating its assets among ETFs that invest in securities of companies in the various sectors of the U.S. market: communication services, consumer discretionary, consumer staples, energy, financials, health care, industrials, information technology, materials, real estate, and utilities. It is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DRIV', 'STOCK', 'Global X Autonomous & Electric Vehicles ETF', 'NGM', NULL, NULL, 'The fund invests at least 80% of its total assets in the securities of the index. The index is designed to provide exposure to exchange-listed companies that are involved in the development of electric vehicles and/or autonomous vehicles, including companies that produce electric/hybrid vehicles, electric/hybrid vehicle components and materials, autonomous driving technology, and network connected services for transportation.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DHX', 'STOCK', 'DHI Group, Inc.', 'NYQ', 'Technology', 'Software - Application', 'DHI Group, Inc. is a provider of AI-powered career marketplaces that focus on technology roles. The Companys brands enable recruiters and hiring managers to search for and connect with technology professionals based on the skills requested. Its segments include ClearanceJobs and Dice. ClearanceJobs is an online career community dedicated to connecting security-cleared professionals with employers in a secure and private environment to fill the jobs that safeguard the nation. The platform provides opportunities for employers and candidates to engage in real-time through messaging and live video, and for employers to promote differentiators through a multitude of branding products and features. Dice is a destination for technology and engineering talent in the United States to find relevant job opportunities. Job postings are available from both technology and non-technology companies across many industries, including positions for software engineers, big data professionals, and others.', 'Centennial, CO, United States', 414);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DJCO', 'STOCK', 'Daily Journal Corporation', 'NCM', 'Technology', 'Software - Application', 'Daily Journal Corporation publishes newspapers and websites covering California and Arizona news and produces several specialized information publications. The Company also serves as a newspaper representative specializing in public notice advertising. The Companys segment includes Traditional Business and Journal Technologies. The Traditional Business segment includes newspapers and related online publications: Los Angeles Daily Journal, San Francisco Daily Journal, Daily Commerce, The Daily Recorder, The Inter-City Express, San Jose Post-Record, Orange County Reporter, The Daily Transcript, Business Journal and The Record Reporter. The Company operates the Journal Technologies segment through Journal Technologies, Inc., which provides case management software systems and related products to courts, prosecutor and public defender offices, probation departments and other justice agencies, including administrative law organizations, city and county governments and bar associations.', 'Los Angeles, CA, United States', 400);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DRUG', 'STOCK', 'Bright Minds Biosciences Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Bright Minds Biosciences Inc. is a biotechnology company, which is engaged in developing treatments for patients with neurological and psychiatric disorders. The Company is focused on developing highly selective 5-HT2 agonists for the treatment of drug-resistant epilepsy, depression, and other central nervous system (CNS) disorders. Its Serotonin (5-HT) is a neurotransmitter in the brain and modulates many biological functions. Dysfunction of serotonin receptors, transporters, and associated neurocircuits is fundamental to many diseases including epilepsies and neuro psychiatric. Its pipeline includes BMB-101, BMB-xxx, BMB-201, and BMB-202. The Company has a portfolio of patented, selective serotonin (5-HT2C, 5-HT2A and 5-HT2C/A-receptor subtypes) agonists that were identified by using high-throughput screening methods in combination with advanced molecular modeling techniques to interrogate the interaction between the drug and its targeted receptors to increase downstream signaling.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ENGN', 'STOCK', 'enGene Holdings Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'enGene Holdings Inc. is a clinical-stage biotechnology company mainstreaming genetic medicines through the delivery of therapeutics to mucosal tissues and other organs. The Companys lead program is detalimogene voraplasmid, (detalimogene) for patients with non-muscle invasive bladder cancer (NMIBC), a disease with a high clinical burden. Detalimogene is being evaluated in the ongoing multi-cohort LEGEND Phase II study, which includes a cohort studying detalimogene in Bacillus Calmette-Guerin (BCG)-unresponsive patients with carcinoma in situ (Cis). Detalimogene is being developed through its proprietary Dually Derivatized Oligochitosan (DDX) platform, which enables penetration of mucosal tissues and delivery of a wide range of sizes and types of cargo, including DNA and various forms of RNA. The Company is developing non-viral genetic medicines based on its DDX gene delivery platform, which allows localized delivery of multiple gene cargos directly to mucosal tissues and other organs.', 'Montreal, QC, Canada', 56);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRTX', 'STOCK', 'BioRestorative Therapies, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'BioRestorative Therapies, Inc. is engaged in developing therapeutic products using cell and tissue protocols, primarily involving adult stem cells. The Company has two core programs that relate to the treatment of disc/spine disease and metabolic disorders. Its lead cell therapy candidate, BRTX-100, is a product formulated from autologous (or a person''s own) cultured mesenchymal stem cells collected from the patient''s bone marrow. It has commenced a Phase II clinical trial using BRTX-100 to treat chronic lower back pain arising from degenerative disc disease. The Company is engaged in developing a cell-based therapy candidate, ThermoStem Program, which targets obesity and metabolic disorders using brown adipose (fat) derived stem cells to generate brown adipose tissue (BAT). It has also licensed an investigational curved needle device designed to deliver cells and/or other therapeutic products or material to the spine and discs. It also operates a commercial biocosmeceutical platform', 'Melville, NY, United States', 11);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FET', 'STOCK', 'Forum Energy Technologies, Inc.', 'NYQ', 'Energy', 'Oil & Gas Equipment & Services', 'Forum Energy Technologies, Inc. is a global manufacturing company serving the oil, natural gas, industrial and renewable energy industries. Its segments include Drilling and Completions and Artificial Lift and Downhole. The Drilling and Completions segment designs, manufactures and supplies products and solutions to the drilling, subsea, coiled tubing, well stimulation and intervention markets, including applications in the oil and natural gas, renewable energy, defense and communications industries. The products and solutions include capital equipment and consumable products, wireline cable and pressure control equipment, and coiled tubing strings and pressure control equipment. The Artificial Lift and Downhole segment designs, manufactures and supplies products and solutions for the artificial lift, well construction, production and infrastructure markets. Its products include well construction casing and cementing equipment, customized downhole technology solutions, and others.', 'Houston, TX, United States', 1800);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EDSA', 'STOCK', 'Edesa Biotech, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Edesa Biotech, Inc. is a clinical-stage biopharmaceutical company developing various ways to treat inflammatory and immune-related diseases. The Company''s most advanced drug candidate is EB05 (paridiprubart), a monoclonal antibody developed for acute and chronic disease indications that involve dysregulated innate immune responses. It is evaluating EB05 in a Phase III study as a potential treatment for acute respiratory distress syndrome, a life-threatening form of respiratory failure. EB05 has also been included in a United States government funded platform study of host directed therapeutics. It has received Canadian regulatory approval to conduct a Phase II trial its EB06 (anti-CXCL10) monoclonal antibody as a treatment for vitiligo, a life-altering autoimmune disease that causes skin to lose its color in patches. It is developing an sPLA2 inhibitor, EB01 (1.0% daniluromer cream), as a topical treatment for chronic Allergic Contact Dermatitis, a common occupational skin condition.', 'Markham, ON, Canada', 16);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CACC', 'STOCK', 'Credit Acceptance Corporation', 'NMS', 'Financial Services', 'Credit Services', 'A Credit Acceptance Corporation está empenhada em fornecer soluções de financiamento que permitem aos concessionários de automóveis vender veículos aos consumidores. Os programas de financiamento da Companhia são oferecidos através de uma rede nacional de concessionárias de automóveis. Sua carteira de empréstimos é composta por dois segmentos de carteira: Empréstimos de concessionárias e empréstimos comprados. A empresa oferece dois programas: O Programa de Portfólio e o Programa de Compra. No âmbito do Programa Portfolio, a Empresa avança dinheiro para os concessionários em troca do direito de prestar serviços aos empréstimos subjacentes ao consumidor. No âmbito do Programa de Compra, a Empresa compra os empréstimos ao consumidor junto dos concessionários e mantém todos os montantes recolhidos junto do consumidor. Seu mercado-alvo consiste em aproximadamente 60 000 negociantes de automóveis independentes e franqueados nos Estados Unidos. A empresa tem gerentes de área de mercado local', 'Southfield, MI, United States', 2431);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVLG', 'STOCK', 'Covenant Logistics Group, Inc.', 'NYQ', 'Industrials', 'Trucking', 'Covenant Logistics Group, Inc., through its subsidiaries, offers a portfolio of transportation and logistics services to customers throughout the United States. The Companys primary services include asset-based expedited and dedicated truckload capacity, as well as asset-light warehousing, transportation management, and freight brokerage capability. Its Expedited segment primarily provides truckload services to customers with high service freight and delivery standards. Its Dedicated segment provides customers with committed truckload capacity over contracted periods. Its Managed Freight segment includes its brokerage services and transport management services (TMS). Its Warehousing reportable segment provides day-to-day warehouse management services to customers who have chosen to outsource this function. It also provides shuttle and switching services related to shuttling containers and trailers in or around freight yards and to/from warehouses.', 'Chattanooga, TN, United States', 3100);\n
